#include <iostream>
#include <vector>

using namespace std;

const int INF = 2e9;

struct Edge { //   ,        
    int a, b, w;
};

vector<vector<int>> G; // G -  

void dfs(int v, vector<bool> &was) { // dfs -    ,    ,   v     was
    was[v] = true; // ,   v- 
    for (int nxt : G[v]) { //   ,   v-
        if (!was[nxt]) { //       nxt- ,    dfs  
            dfs(nxt, was); //  dfs  nxt- 
        }
    }
}

void solve() {
    int n, m;
    cin >> n >> m; //  -   
    G.resize(n);
    vector<Edge> ve(m); //   
    for (int i = 0; i < m; ++i) { //   
        cin >> ve[i].a >> ve[i].b >> ve[i].w; //      
        //      1,         1,     ,      0
        ve[i].a--;
        ve[i].b--;
        G[ve[i].a].push_back(ve[i].b); //      ve[i].a-   ve[i].b
    }
    vector<int> d(n, -INF); // d[i] = x, ,        0  i  x
    d[0] = 0; //   0-      0- ,     0
    for (int k = 0; k < n - 1; ++k) { //  
        for (Edge edge : ve) { //  
            if (d[edge.a] != -INF && d[edge.b] < d[edge.a] + edge.w) { //    - ,   d[edge.a],     edge.b ,    edge,   
                d[edge.b] = min(INF, d[edge.a] + edge.w); //   min  INF,                  -  
            }
        }
    }
    vector<bool> in_cycle(n, false); // in_cycle[v] = true, ,   v-      
    //       ,  -      d  (k - 1)- ,   k-     ,        (           )
    for (Edge edge : ve) {  //  
        if (d[edge.a] != -INF && d[edge.b] < d[edge.a] + edge.w) {  //    - ,   d[edge.a],     edge.b ,    edge,   
            in_cycle[edge.b] = true; // ,   v-      
            d[edge.b] = min(INF, d[edge.a] + edge.w); //   min  INF,                  -  
        }
    }
    if (d[n - 1] == -INF) { //  d[n - 1] = -INF,      0-   (n - 1)-
        cout << ":(";
        return;
    }
    bool have_pos_cycle = false; // have_pos_cycle = true,    0-      ,       (n - 1)- 
    vector<bool> was2(n, false); // was2[v] = true,   0-     v-
    dfs(0, was2); //  dfs  0-,    was2
    for (int i = 0; i < n; ++i) { //  
        if (!in_cycle[i]) { //        ,   
            continue;
        }
        vector<bool> was1(n, false); // was1[v] = true,   i-     v-
        dfs(i, was1); //  dfs  i- ,  ,     
        if (was2[i] && was1[n - 1]) { //    0-    i-,    i-   (n - 1)-,      
            have_pos_cycle = true; // ,      
        }
    }
    if (have_pos_cycle) { //     , ,   ,  :)
        cout << ":)";
    } else { //   
        cout << d[n - 1]; //      0  (n - 1)
    }
}

